import React, { useState } from "react";
import { collection, query, where, getDocs } from "firebase/firestore";
import { db } from "../init-firebase";
import Swal from "sweetalert2";
import "../styles/home.css";
import { Helmet } from "react-helmet";
import Footer from "./Footer";
import NavbaR from "./navbar";

const DonersData = () => {
  const [city, setCity] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [donors, setDonors] = useState([]);

  // Function to handle form submission
  const DonerBtn = async (e) => {
    e.preventDefault();

    // Check if both bloodGroup and city are provided
    if (!bloodGroup || !city) {
      Swal.fire("Please add both city and blood group");
      return;
    }

    try {
      // Prepare the conditions for the Firestore query
      const searchDonors = [];
      if (bloodGroup) {
        searchDonors.push(where("DonerBloodGroup", "==", bloodGroup)); // Make sure this field exists in Firestore
      }
      if (city) {
        searchDonors.push(where("CityName", "==", city)); // Make sure this field exists in Firestore
      }

      // Create a query with the filters
      const donorQuery = query(collection(db, "SinupUser"), ...searchDonors);

      // Debugging: Log the query to check its structure
      console.log("Query: ", donorQuery);

      // Fetch matching donors from Firestore
      const querySnapshot = await getDocs(donorQuery);

      // Map over the Firestore results to structure the data
      const matchedDonors = querySnapshot.docs.map((doc) => ({
        id: doc.id,
        DonerName: doc.data().Name,  // Make sure 'Name' exists in the document
        DonerBloodGroup: doc.data().DonerBloodGroup, // Ensure correct field name
        CityName: doc.data().CityName, // Ensure correct field name
        ContactNo: doc.data().mobilt, // Ensure correct field name
      }));

      // Log the donors to debug
      console.log(matchedDonors);

      // If no donors are found, show an alert
      if (matchedDonors.length === 0) {
        Swal.fire("No donors found for the selected blood group and city.");
      } else {
        setDonors(matchedDonors); // Set the matched donors in state
      }
    } catch (error) {
      console.error("Something went wrong:", error);
      Swal.fire("Error", "Firebase Error", "error");
    }
  };

  return (
    <div className="contact-us-container">
      <Helmet>
        <title>Donor</title>
      </Helmet>
      <NavbaR />
      <h2 className="text-2xl font-bold mb-4 text-center">Find Blood Donors</h2>
      <form onSubmit={DonerBtn} className="space-y-4 max-w-lg mx-auto">
        <div>
          <label className="block text-gray-700 font-medium">City</label>
          <input
            type="text"
            className="w-full border border-gray-300 rounded-lg px-4 py-2 text-sm"
            placeholder="Enter your city"
            value={city}
            onChange={(e) => setCity(e.target.value)} // Removed toLowerCase for better matching
            required
          />
        </div>
        <div>
          <label className="block text-gray-700 font-medium">Blood Group</label>
          <input
            type="text"
            className="w-full border border-gray-300 rounded-lg px-4 py-2 text-sm"
            placeholder="Enter blood group (e.g., A+, O-)"
            value={bloodGroup}
            onChange={(e) => setBloodGroup(e.target.value)}
            required
          />
        </div>
        <button
          type="submit"
          className="bg-red-500 text-white px-4 py-2 rounded-lg hover:bg-red-600 w-full"
        >
          Find Donor
        </button>
      </form>

      <div className="mt-6 max-w-screen-xl mx-auto">
        {donors && donors.length > 0 ? (
          <div>
            <h3 className="text-lg font-bold mb-6 text-center text-red-600">
              Matching Donors
            </h3>
            <div className="grid gap-6 px-6 sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-4">
              {donors.map((donor, index) => (
                <div
                  key={index}
                  className="bg-white rounded-lg shadow-lg p-6 transform transition-transform duration-300 hover:-translate-y-2 hover:shadow-2xl"
                >
                  <h3 className="text-xl font-bold text-gray-800 mb-2">
                    {donor.DonerName}
                  </h3>
                  <p className="text-sm text-gray-600 mb-1">
                    <strong>Blood Group:</strong> {donor.DonerBloodGroup}
                  </p>
                  <p className="text-sm text-gray-600 mb-1">
                    <strong>City:</strong> {donor.CityName}
                  </p>
                  <p className="text-sm text-gray-600">
                    <strong>Contact:</strong> {donor.ContactNo}
                  </p>
                  <button className="mt-4 px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700">
                    Contact
                  </button>
                </div>
              ))}
            </div>
          </div>
        ) : null}
      </div>
      <Footer />
    </div>
  );
};

export default DonersData;
